// Step 1: Get the raw 'pretty' string
const rawText = $input.first().json.body.pretty || "";
const keyValuePairs = rawText.split(',').map(entry => entry.trim());

// Step 2: Map known keys
const keyMap = {
  "Resident Name": "Resident Name",
  "Autofill trigger": "Resident Name",
  "Medicade Number": "Medicade Number",
  "Social Security Number": "Social Security Number",
  "Service Provided": "Service Provided",
  "Provider Number": "Provider Number",
  "Date": "Date",
  "Start Time": "Start Time",
  "End Time": "End Time",
  "Total Time": "Total Time",
  "Time in Quater Hours": "Time in Quater Hours",
  "Goal": "Goal",

  // For flexibility — retain previously mapped fields too
  "Medicaid_Number": "Medicade Number",
  "reshabProvider": "Provider Number",
  "ServiceCodes": "Service Provided",
  "Start Date": "Date",
  "End Date": "Date",
  "planstart": "Date",
  "planend": "Date"
};

// Step 3: Build final object with cleaned keys and formatted values
const result = {};
for (const pair of keyValuePairs) {
  const [rawKey, ...rest] = pair.split(':');
  if (!rawKey || rest.length === 0) continue;

  const cleanKey = rawKey.trim();
  const mappedKey = keyMap[cleanKey] || cleanKey;
  let value = rest.join(':').trim();

  // ✅ Auto-format "date-like" values: e.g., 04 04 2025 → 04-04-2025
  if (/^\d{2} \d{2} \d{4}$/.test(value)) {
    value = value.replace(/ /g, '-');
  }

  result[mappedKey] = value;
}

// Step 4: Add metadata if needed
result["Sheet Name"] = $input.first().json["Sheet Name"] || "Form Submission Data";
result["Row Number"] = $input.first().json["Row Number"] || "";

// ✅ STRONG TRIM for Resident Name to fix Switch node
if (result["Resident Name"]) {
  result["Resident Name"] = result["Resident Name"]
    .replace(/\s+/g, ' ') // remove extra internal spaces
    .replace(/\u00A0/g, ' ') // remove non-breaking spaces
    .trim(); // final trim
  console.log("Cleaned Resident Name:", `"${result["Resident Name"]}"`);
}

return [{ json: result }];

function generateSummary() {
  const input = $input.first().json;

  const residentName = input['Resident Name'];
  const medicaidNumber = input['Medicade Number'];
  const ssn = input['Social Security Number'];
  const service = input['Service Provided'];
  const providerNumber = input['Provider Number'];
  const date = input['Date'];
  const startTime = input['Start Time'];
  const endTime = input['End Time'];
  const totalTime = input['Total Time'];
  const quarterHours = input['Time in Quater Hours'];
  const goal = input['Goal'];

  return `${residentName} (Medicaid #${medicaidNumber}, SSN: ${ssn}) received "${service}" on ${date} from ${startTime} to ${endTime} (Total: ${totalTime}, Quarter Hours: ${quarterHours}). Service was provided by #${providerNumber}. The session focused on the goal: "${goal}".`;
}

// Output the summary
return [{ json: { summary: generateSummary() } }];
